import React, {Component} from 'react'
import '../App.css'
export class Basic extends Component{
    render(){
        return(
            <div>
                <h2>
                Welcome Doctor_Name<br></br>
                {/* <hr></hr> */}
                Doc ID:
                </h2>
            </div>
        )
    }
}

export class Alerts extends Component{
    render(){
        return(
        <div>
            <div className="title">
                Alerts
            </div>
            <div className="patients">
                Sumanth
            </div>
            <div className="patients">
                Saketh
            </div>
            <div className="patients">
                Kumar
            </div>
        </div>
        )
    }
}

export class Patients extends Component{
    constructor(props){
        super(props)
        this.state={
            name_list:['Sumanth','Rakesh','Saketh']
        }
    }
     patient_list=this.state.name_list.map(
        (person) => {
            return <span>{person}</span>
        }
     ) 
    render(){
        return(
        <div>
            <div className="title">
               Registered Patients

           </div>
           <div className="patients">
               {this.patient_list}
           </div>
            {/* <div className="patients">
                Sumanth
            </div>
            <div className="patients">
                Saketh
            </div>
            <div className="patients">
                Kumar
            </div> */}
        </div>
        )
    }
}
